import * as React from 'react';
import { Text, View, Button } from 'react-native';


export default function HarrisRipp({ navigation }) {
  return (
    <View style={{ flex: 3, alignItems: 'center', justifyContent: 'center' }}>
      <Text>About Harris Ripp</Text>
      <Text> </Text>
      <Text>Harris is from New York City and has been programming since 2014. He speaks Hebrew and Spanish along with English </Text>
      <Text>and can communicate in Morse Code. He and loves to ski, run, and bike. Harris also enjoys soccer, baseball, and Ultimate Frisbee. </Text>
    </View>

  );
}
